SELECT ?name ?father_party
WHERE {
  ?alumnus a foaf:Person;
    rdf:type foaf:Alumnus ;
    foaf:name ?name .
  ?alumnus's father ?father .
  ?father a foaf:Person;
    rdf:type foaf:Person ;
    rdfs:label ?father_party .
}
```

This query uses the FOAF (Friend of a Friend) vocabulary to describe people and their relationships. It selects the name of the alumnus and the party of their father.

